import React, { Component } from "react";
import Header from "./components/Header";
import Discover from "./components/Discover";
import "./App.css";

import Dramas2018 from "./components/NowPlaying";

export class App extends Component {
  render() {
    return (
      <div>
        <Header />
        <Discover />

        <Dramas2018 />
      </div>
    );
  }
}

export default App;
